import React, { useEffect, useState } from 'react'

import './Hotel.css'
import {Routes, Route ,Link} from "react-router-dom";
import Carosuel from './Carosuelf';
import Hotelmenu from './Hotelmenu'
import axios from "axios";
import '../App.css'


const Hotel = (props) => {
  const[restaurants,setproducts]=useState([])
  useEffect(()=>{
    async function fetchProducts()
    {
      const {data}=await axios.get('/api/products/')
      setproducts(data)
    }
    fetchProducts()
  },[])
  const[k1,setk]=useState(props.obj)
  useEffect(()=>{
    setk(props.obj)
  },[props])
  function price() {
    let newp = props.obj.sort((a, b) => (a.price > b.price) ? 1 : (a.price < b.price) ? -1 : 0)
    setk([...newp]);
  }
  function priceh() {
    let newp1 = props.obj.sort((a, b) => (a.price < b.price) ? 1 : (a.price > b.price) ? -1 : 0)
    setk([...newp1]);
  }
  function rating() {
    let newk = props.obj.sort((a, b) => (a.rating > b.rating) ? 1 : (a.rating < b.rating) ? -1 : 0)
    setk([...newk]);
  }
  
  function ratingh() {
    let newk1 = props.obj.sort((a, b) => (a.rating < b.rating) ? 1 : (a.rating > b.rating) ? -1 : 0)
    setk([...newk1]);
  }
  function time() {
    let newt = props.obj.sort((a, b) => (a.time > b.time) ? 1 : (a.time < b.time) ? -1 : 0)
    setk([...newt]);
  }
  function timeh() {
    let newh = props.obj.sort((a, b) => (a.time < b.time) ? 1 : (a.time > b.time) ? -1 : 0)
    setk([...newh]);
  }
  
  return (<>
      <Carosuel color={props.color}></Carosuel> 
      <div style={{backgroundColor:`${props.color}`}}>
      <nav className="navbar navbar-expand-lg bg-body-tertiary">
    <div className="container-fluid row">
      <a className="navbar-brand font-weight-bold pl-5 col-md-9 id1" style={{color:`${props.color==='black'?'white':'black'}`}}>{restaurants.restaurant.length} Restaurants</a>
      <div className="pl-5 dropdown col-md-2">
                    <button className={`btn btn-${props.color==='black'?'light':'dark'} dropdown-toggle dropdown profiledropdow`} type="button" id="dropdownMenuButton" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false"><svg xmlns="http://www.w3.org/2000/svg" width="20" height="16" fill="currentColor" class="bi bi-filter" viewBox="0 0 16 16">
                        <path d="M6 10.5a.5.5 0 0 1 .5-.5h3a.5.5 0 0 1 0 1h-3a.5.5 0 0 1-.5-.5zm-2-3a.5.5 0 0 1 .5-.5h7a.5.5 0 0 1 0 1h-7a.5.5 0 0 1-.5-.5zm-2-3a.5.5 0 0 1 .5-.5h11a.5.5 0 0 1 0 1h-11a.5.5 0 0 1-.5-.5z" />
                    </svg> Filter</button><div class="dropdown-menu" aria-labelledby="dropdownMenuButton">
                        <a className="dropdown-item" onClick={price} >Price:Low To High</a>
                        <a className="dropdown-item" onClick={priceh} >Price:High To Low</a>
                        <a className="dropdown-item" onClick={rating} >Rating:Low To High</a>
                        <a className="dropdown-item" onClick={ratingh} >Rating:High To Low</a>
                        <a className="dropdown-item" onClick={time} >Time:Low To High</a>
                        <a className="dropdown-item" onClick={timeh} >Time:High To Low</a>
                    </div>
      </div>
    </div>
  </nav>
    <div className="container pt-2 pb-5">
    <div className="row">
    {restaurants.map((i)=>
        {
          return(<>
        <Link className="col-lg mx-auto container justify-content-center p-3 hi" to={i.id} align="center" style={{textDecoration: "none",color:`${props.color==='black'?'white':'black'}`}}>
        <img src={i.path} alt="" style={{width:'250px',height:'150px',borderRadius:'10px'}} /> 
        <h5 className="font-weight-bold pt-2">{i.name}</h5>
        <pre className="text-muted" style={{fontSize:"small"}}>{i.description}</pre>
          <div className="text-muted" style={{fontSize:"x-small"}}>{props.value && <div className="col-lg"><button disabled="" className="btn btn-success btn-sm"><svg
                xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-star-fill"
